import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

import './App.css';
import SecuredPage from './SecuredPage';


export default function App() {
  return (
<BrowserRouter>
<Router>
  <Routes></Routes>
      <Route path="/secured" element={<SecuredPage />} />
</Router>
</BrowserRouter>
  )
};
